import { Button, Snackbar } from '@mui/joy';
import { useDispatch, useSelector } from 'react-redux';
import './App.css';
import Login from './Views/Login/Login';
import { closeSnackbar, openSnackbar } from './store/actions';
import { checkHealth } from './store/services/userService';

function App() {
  const dispatch = useDispatch();
  const snackbar = useSelector((state: any) => state.app.snackbar);
  const isLoading = useSelector((state: any) => state.app.isLoading);
  return (
    <>
      <Button
        variant="solid"
        color="primary"
        onClick={() =>
          checkHealth()
            .then((res) => {
              dispatch(openSnackbar('success', 'API is healthy'));
            })
            .catch((err) => {
              dispatch(openSnackbar('danger', 'API is not healthy'));
            })
        }
      >
        API Healt check
      </Button>
      <Login />
      <Snackbar
        open={snackbar?.isOpen}
        onClose={() => dispatch(closeSnackbar())}
        variant="solid"
        color={snackbar?.severity}
        autoHideDuration={2000}
        anchorOrigin={{ horizontal: 'left', vertical: 'bottom' }}
      >
        {snackbar?.message}
      </Snackbar>
    </>
  );
}

export default App;
